library(shiny)
library(colorspace)
library(bslib)
library(ggplot2)
library(dplyr)
library(plotly)
library(ggmosaic)

youhealth <- read.csv("data_cleaned.csv")
density_dat <- read.csv("density_dat.csv")
youhealth$SEX <- factor(youhealth$SEX, levels = 1:2, labels = c("männlich", "weiblich"))
youhealth$tabak <- factor(youhealth$tabak, levels = 0:1, labels = c("Nichtraucher", "Raucher"))

label_list <- list(
  "AGE_AT_EXAMINATION" ~ "Alter <span style='color:#666666; font-style:italic;'>(Jahre)</span>",
  "bmi" ~ "BMI <span style='color:#666666; font-style:italic;'>(kg/m\u00B2)</span>",
  "ANTHROPOMETRY_HEIGHT" ~ "Größe <span style='color:#666666; font-style:italic;'>(cm)</span>",
  "SEX" ~ "Geschlecht",
  "tabak" ~ "Rauchen & Dampfen",
  "LE8_total" ~ "Life's Essential 8 Punkte"
)

scales <- data.frame(variable = c("AGE_AT_EXAMINATION", "bmi", "ANTHROPOMETRY_HEIGHT",
                                  "SEX", "LE8_total", "tabak"),
                     continuous = c(1, 1, 1, 0, 1, 0))
labels <- c(
  "Alter" = "AGE_AT_EXAMINATION",
  "BMI" = "bmi",
  "Größe" = "ANTHROPOMETRY_HEIGHT",
  "Geschlecht" = "SEX",
  "Life's Essential 8 Score" = "LE8_total",
  "Rauchen & Dampfen" = "tabak"
)

