# Define UI for application that draws a histogram

ui <- page_navbar(
  title = HTML("<b>YOUhealTH</b>"), 
  theme = bs_theme(
    base_font = font_collection(font_face("Helvetica Neue", "sans-serif")),
    precompiled = TRUE
  ),
  tags$style(HTML("
    .custom-card-header {
      background-color: #E3E3E3;
      color: #1c1c1c;
      padding: 10px;
      border-top-left-radius: 12px;
      border-top-right-radius: 12px;
      font-weight: bold;
    }

    .card, .value-box {
       background-color: #ffffff;
       border-radius: 12px;
       box-shadow: 0 4px 10px rgba(0, 0, 0, 0.05);
       padding: 10px;
    }

    body {
      font-family: 'Helvetica Neue', sans-serif;
      background-color: #f9f9f9;
      color: #1c1c1c;
    }
    .info-box {
      background-color: #e7f3fe;
      border-left: 5px solid #2196F3;
      padding: 12px 16px;
      margin-bottom: 16px;
      border-radius: 5px;
      font-family: sans-serif;
    }
    .btn-primary {
    background-color: #0074D9;
    border-color: #0074D9;
  }
  .btn-primary:hover {
    background-color: #005fa3;
    border-color: #005fa3;
  }
  table.dataTable {
    background-color: white;
    border: none;
  }
  h1, h2, h3 {
    color: #1c1c1c;
    font-weight: 600;
  }
  ")),
  nav_panel(
    "Life's Essential 8", 
            layout_sidebar(
              sidebar = sidebar(
                title = "Life's Essential 8",
                radioButtons("plottype", HTML("<b>Darstellung:</b>"),
                             choices = c("Dichteschätzer" = "Dichteschätzer", "Histogramm" = "Histogramm"),
                             selected = "Histogramm"),
                checkboxGroupInput("le8dimensions", HTML("<b>LE8 Dimensionen:</b>"),
                                   choices = c("Blutdruck" = "Blutdruck", "Blutfettwerte" = "Blutfettwerte",
                                               "Blutglucose" = "Blutglucose", "BMI" = "BMI",
                                               "Ernährung" = "Ernährung", "Rauchen" = "Rauchen",
                                               "Schlaf" = "Schlaf", "Sport und Bewegung" = "Sport und Bewegung")
                ),
                selectInput("densgroup", HTML("<b>Gruppe:</b>"), 
                            choices = c("Alle" = "Alle", "Jugendliche" = "Jugendliche", 
                                        "Erwachsene" = "Erwachsene"))
              ),
              layout_columns(
                fill = FALSE,
                uiOutput("avg_box"),
                uiOutput("median_box"),
                uiOutput("range_box")
              ),
              layout_columns(
                uiOutput("n_box"),
                card(
                  card_header("Life's Essential 8 - Gesamtpunkte", tooltip(bsicons::bs_icon("info-circle"), "Die „Life's Essential 8“ sind wichtige Maßnahmen zur Verbesserung und Erhaltung der kardiovaskulären Gesundheit. Sie wurden von der American Heart Association definiert. Eine bessere kardiovaskuläre Gesundheit trägt u.a. dazu bei, das Risiko für Herzkrankheiten und Schlaganfälle zu senken.", placement = "bottom"), class = "custom-card-header"),
                  plotOutput("p")
                ),
                col_widths = c(4, 8)
              ),
              card(
                card_header("Life's Essential 8 - Unterkategorien", tooltip(bsicons::bs_icon("info-circle"), "Die Life's Essential 8 umfassen acht Komponenten aus zwei Bereichen: Gesundheitsverhalten und Gesundheitsfaktoren.", placement = "bottom"), class = "custom-card-header"),
                plotOutput("p2")
              )
            )
  ),
  nav_panel("Demographie",
            layout_sidebar(
              sidebar = sidebar(
                title = "Demographie",
                HTML('<div class="info-box">
        <p><b>Hinweis:</b> Hier findet ihr einige grundsätzliche demographische Informationen zu den Daten.</p>
        <p>Diese helfen dabei, sich einen grundlegenden Überblick zu verschaffen.</p>
        </div>')
              ),
              mainPanel(
                htmlOutput("summary_table")
              )
            )
  ),
  nav_panel("Zusammenhänge erforschen",
            layout_sidebar(
              sidebar = sidebar(
                title = "Zusammenhänge erforschen",
                selectInput("zshg1", "Wähle die erste Variable:", 
                            choices = labels),
                selectInput("zshg2", "Wähle die zweite Variable:", 
                            choices = labels),
                selectInput("zgroup", "Gruppe:", 
                            choices = c("Jugendliche" = "Jugendliche", "Erwachsene" = "Erwachsene")),
                HTML('<div class="info-box">
        <p><b>Vorgehen:</b> Wähle zwei Variablen aus den Drop-Down Menüs aus.</p>
        <p>Visualisiere so den Zusammenhang zwischen den beiden Variablen.</p> 
        <p>Kannst du einen Zusammenhang erkennen?</p>
        </div>')
              ),
              plotOutput("p3")
            )),
  nav_panel("Informationen",
            HTML('<div class="info-box">
        <p><b>Hinweis:</b> Die angezeigten Daten wurden leicht verändert, damit keine Rückschlüsse auf einzelne Personen möglich sind.</p> 
        <p>Um die Anonymität der teilnehmenden Personen zu gewährleisten, beinhaltet dieses Dashboard nicht die Originaldaten. Die Originaldaten wurden mit einem zufallbasierten Rauschen überlagert und außerdem wurde der Datensatz synthetisch erweitert. So sind keine Rückschlüsse auf die teilnehmenden Personen mehr möglich.</p>
        <p>So bleibt der Datenschutz gewahrt - und ihr könnt die Daten trotzdem gut auswerten!</p>
        </div>'),
            layout_columns(
              HTML('
              <div class="info-box">
              <p><b>Mehr erfahren:</b> Die Life\'s Essential 8 wurden von der American Heart Association entwickelt, um ein umfassendes Bild der kardiovaskulären Gesundheit zu liefern.</p>
              <p>Scanne den QR-Code oder klicke auf den Link, um direkt zur Publikation zu gelangen, welche die von uns verwendete Berechnungsmethode der Scores enthält.</p>
              <p><small><a href="https://www.ahajournals.org/doi/10.1161/CIR.0000000000001078" target="_blank">
              Life’s Essential 8: Updating and Enhancing the American Heart Association’s Construct of Cardiovascular Health
              </a></small></p>
              </div>
                   '),

              card(
                div(
                  style = "display: flex; justify-content: center; align-items: center; height: 100%;",
                  tags$img(src = "le8_qr.png", style = "max-height: 200px; width: auto; aspect-ratio: 1 / 1; object-fit: contain;")
                )
              ),
              col_widths = c(8, 4)
            )
            )
)

# Define server logic required to draw a histogram
server <- function(input, output) {

  # # QR Code 
  # output$qrcode <- renderImage({
  #   
  #   list(src = "le8_qr.png",
  #        width = "100%",
  #        height = 330)
  #   
  # }, deleteFile = F)

  # Median, Durchschnitt, Spannweite, n
  masse <- reactive({
    df <- youhealth
    if (input$densgroup != "Alle") {
      df <- df[df$GROUP == input$densgroup, ]
    }
    c(
      mean(df$LE8_total, na.rm = TRUE),
      median(df$LE8_total, na.rm = TRUE),
      max(df$LE8_total, na.rm = TRUE) - min(df$LE8_total, na.rm = TRUE)
    )
  })
  detn <- reactive({
    df <- youhealth
    if (input$densgroup != "Alle") {
      df <- df[df$GROUP == input$densgroup, ]
    }
    c(nrow(df), 4)
  })
  output$n_box <- renderUI({
    value_box(
      title = "Anzahl",
      value = scales::unit_format(unit = " Personen")(detn()[[1]]),
      showcase = bsicons::bs_icon("person-raised-hand"),
      theme = "teal"
    )
  })
  output$avg_box <- renderUI({
    value_box(
      title = "Durchschnittliche Punkte",
      value = scales::unit_format(unit = " Punkte")(masse()[[1]]),
      showcase = bsicons::bs_icon("heart-pulse-fill"),
      theme = "primary"
    )
  })
  output$median_box <- renderUI({
    value_box(
      title = "Medianpunkte",
      value = scales::unit_format(unit = " Punkte")(masse()[[2]]),
      showcase = bsicons::bs_icon("align-center"),
      theme = "primary"
    )
  })
  output$range_box <- renderUI({
    value_box(
      title = "Spannweite",
      value = scales::unit_format(unit = " Punkte")(masse()[[3]]),
      showcase = bsicons::bs_icon("arrows"),
      theme = "primary"
    )
  })
  # LE8 pane
  output$p <- renderPlot({
    if (input$plottype == "Dichteschätzer") {
      if (input$densgroup == "Alle") {
        ggplot(youhealth) +
          geom_density(aes(x = LE8_total), color = "#0074d9", fill = "#0074d9", alpha = 0.9) +
          labs(x = "Punkte") +
          theme_bw(base_size = 16) + 
          theme(axis.title.y =  element_blank()) 
      } else {
        ggplot(youhealth |> filter(GROUP == input$densgroup)) +
          geom_density(aes(x = LE8_total), color = "#0074d9", fill = "#0074d9", alpha = 0.9) +
          labs(x = "Punkte") +
          theme_bw(base_size = 16) + 
          theme(axis.title.y =  element_blank())
      }
    } else {
      if (input$densgroup == "Alle") {
        ggplot(youhealth) +
          geom_histogram(aes(x = LE8_total), color = "#0074d9", fill = "#0074d9", alpha = 0.9, breaks = seq(0, 100, 5)) +
          labs(x = "Punkte") +
          theme_bw(base_size = 16) + 
          theme(axis.title.y =  element_blank())
      } else {
        ggplot(youhealth |> filter(GROUP == input$densgroup)) +
          geom_histogram(aes(x = LE8_total), color = "#0074d9", fill = "#0074d9", alpha = 0.9, breaks = seq(0, 100, 5)) +
          labs(x = "Punkte") +
          theme_bw(base_size = 16) + 
          theme(axis.title.y =  element_blank())
      }
    }
  })
  output$p2 <- renderPlot({
    if (input$plottype == "Dichteschätzer") {
      if (input$densgroup == "Alle") {
        ggplot(density_dat |> filter(LE8_Component %in% input$le8dimensions)) +
          geom_density(aes(x = Score, fill = LE8_Component), alpha = 0.6) +
          theme_bw(base_size = 16) +
          labs(fill = "LE8 Dimension", x = "Punkte") +
          theme(
            axis.title.y = element_blank(), 
            legend.title = element_text(face = "bold")
          ) +
          scale_fill_discrete_qualitative(palette = "Cold")
      } else {
        ggplot(density_dat |> filter(GROUP == input$densgroup & LE8_Component %in% input$le8dimensions)) +
          geom_density(aes(x = Score, fill = LE8_Component), alpha = 0.6) +
          theme_bw(base_size = 16) +
          labs(fill = "LE8 Dimension", x = "Punkte") +
          theme(
            axis.title.y = element_blank(), 
            legend.title = element_text(face = "bold")
          ) +
          scale_fill_discrete_qualitative(palette = "Cold")
      }
    } else {
      if (input$densgroup == "Alle") {
        ggplot(density_dat |> filter(LE8_Component %in% input$le8dimensions)) +
          geom_histogram(aes(x = Score, fill = LE8_Component), alpha = 0.6, position = "identity", breaks = seq(0, 100, 5)) +
          theme_bw(base_size = 16) +
          labs(fill = "LE8 Dimension", x = "Punkte") +
          theme(
            axis.title.y = element_blank(), 
            legend.title = element_text(face = "bold")
          ) +
          scale_fill_discrete_qualitative(palette = "Cold")
      } else {
        ggplot(density_dat |> filter(GROUP == input$densgroup & LE8_Component %in% input$le8dimensions)) +
          geom_histogram(aes(x = Score, fill = LE8_Component), alpha = 0.6, position = "identity", breaks = seq(0, 100, 5)) +
          theme_bw(base_size = 16) +
          labs(fill = "LE8 Dimension", x = "Punkte") +
          theme(
            axis.title.y = element_blank(), 
            legend.title = element_text(face = "bold")
          ) +
          scale_fill_discrete_qualitative(palette = "Cold")
      }
    }
  })

  # Demographics pane
  output$summary_table <- renderUI({
    includeHTML("summary_table.html")
  })

  # Zusammenhangsanalyse
  output$p3 <- renderPlot({
    if(scales[which(scales$variable == input$zshg1), 2] + scales[which(scales$variable == input$zshg2), 2] == 2) {
      ggplot(youhealth |> filter(GROUP == input$zgroup), aes(x = .data[[input$zshg1]], y = .data[[input$zshg2]])) +
        geom_point() +
        geom_smooth(method = "gam", formula = y ~ s(x, bs = "ps")) +
        labs(x = names(labels)[labels == input$zshg1], y = names(labels)[labels == input$zshg2]) +
        theme_bw()
    } else if(scales[which(scales$variable == input$zshg1), 2] + scales[which(scales$variable == input$zshg2), 2] == 1) {
      # Define x and y variable
      if(scales[which(scales$variable == input$zshg1), 2] == 0) {
        xvar <- input$zshg1
        yvar <- input$zshg2
      } else {
        xvar <- input$zshg2
        yvar <- input$zshg1
      }
      ggplot(na.omit(youhealth |> filter(GROUP == input$zgroup)), aes(x = .data[[xvar]], y = .data[[yvar]])) +
        geom_boxplot(na.rm = TRUE) +
        labs(x = names(labels)[labels == xvar], y = names(labels)[labels == yvar]) +
        theme_bw()
    } else if(scales[which(scales$variable == input$zshg1), 2] + scales[which(scales$variable == input$zshg2), 2] == 0) {
      filtered_data <- youhealth |> 
        filter(GROUP == input$zgroup)

      # Create a frequency table
      freq_data <- filtered_data |>
        count(
          !!sym(input$zshg1),
          !!sym(input$zshg2),
          name = "n"
        )

      ggplot(youhealth |> filter(GROUP == input$zgroup)) +
        geom_mosaic(aes(x = product(!!sym(input$zshg1)), fill = !!sym(input$zshg2)), na.rm = TRUE) +
        labs(x = names(labels)[labels == input$zshg1], y = names(labels)[labels == input$zshg2]) +
        theme_mosaic() +
        theme(legend.title = element_blank()) +
        scale_fill_discrete_qualitative(palette = "Cold") 
    }
  })
}

# Run the application 
shinyApp(ui = ui, server = server)

